import React from "react";
import { Modal, Form, Input, InputNumber, DatePicker } from "antd";
const CustomModal = ({ visible, handleOk, handleClose, editableData }) => {
  return (
    <Modal visible={visible} onOk={handleOk} onCancel={handleClose}>
      <Form>
        <Form.Item label="Table Number">
          <InputNumber
            style={{ width: "400px" }}
            value={editableData.tableNumber}
          />
        </Form.Item>
        <Form.Item label="CustomerName">
          <Input value={editableData.usernameValue} />
        </Form.Item>
        <Form.Item label="Reserved Seats">
          <Input value={editableData.seats} />
        </Form.Item>
        <Form.Item label="Date">
          <InputNumber style={{ width: "400px" }} value={editableData.date} />
        </Form.Item>
      </Form>
    </Modal>
  );
};

export default CustomModal;
